import { jsPDF } from 'jspdf';

interface Graph {
    percentage: number;
    valueToGrap: number;
    total: number;
    rgb: {
        r: number,
        g: number,
        b: number
    },
    textHelph: string;
}

const addLinesGraphs = (doc: jsPDF, addValue: number = 0) => {
    // * Lineas de grafica
    doc.setLineWidth(0.1);
    doc.setFontSize(7);

    doc.setDrawColor(0, 0, 0, .2);
    for (let i = 0; i <= 10; i++) {
        doc.text(`${i * 10}%`, 15, (110 + addValue)-5*i); 
        doc.line(25, (110 + addValue) - 5 * i, 130, (110 + addValue)-5*i);
    }

}

export const createGraph = (doc: jsPDF, graphs: Graph[], extra: boolean = false) => {
    const addValue = extra ? 7 : 0;
    addLinesGraphs(doc, addValue)
    // * Grafico 
    const spaceGraph = Math.floor((105 - graphs.length * 10) / (graphs.length + 1));
    const spaceDot = Math.floor(45 - (graphs.length * 10));
    doc.setFontSize(10);
    graphs.forEach((graph, idx) => {
        const { b, g, r } = graph.rgb;
        doc.setFillColor(r, g, b);
        doc.circle(150, (60+ addValue) + spaceDot + (10 * idx), 3, "F");
        doc.rect(25 + spaceGraph * (idx + 1) + idx * 10, (110+ addValue - graph.valueToGrap), 10, graph.valueToGrap, "F");
        doc.text(`${graph.textHelph}: ${graph.total}, REPRESENTA EL ${graph.percentage.toFixed(2)}%`, 155, (61+ addValue) + spaceDot + (10 * idx))
    });

}

export const createGraphComparative = (doc: jsPDF, graphs: Graph[]) => {
    addLinesGraphs(doc, 0)
    let newGroups: Array<Graph[]> = [];
    for (let i = 0; i < graphs.length / 2; i++) {
        newGroups = [...newGroups, graphs.slice(i * 2, i * 2 + 2)]
    }

    // * Grafico
    doc.setFontSize(10);
    const spaceGraph = Math.floor((105 - graphs.length * 10) / ((graphs.length / 2) + 1));
    const spaceDot = Math.floor(45 - (graphs.length * 10));
    graphs.forEach((graph, idx) => {
        const { b, g, r } = graph.rgb;
        doc.setFillColor(r, g, b);
        doc.circle(150, 60 + spaceDot + (10 * idx), 3, "F");
        doc.text(`${graph.textHelph}: ${graph.total}, REPRESENTA EL ${graph.percentage.toFixed(2)}%`, 155, 61 + spaceDot + (10 * idx))
    })
    newGroups.forEach((grs, idx) => {
        const space = 25 + spaceGraph * (idx + 1) + idx * 20;
        grs.forEach((gr, i) => {
            const { b, g, r } = gr.rgb;
            doc.setFillColor(r, g, b);
            doc.rect(space + i * 10, (110 - gr.valueToGrap), 10, gr.valueToGrap, "F");
        })
    })
}

export const addFoother = (doc: jsPDF, pageWidth: number, pageHeight: number) => {
    const pages = doc.internal.pages.length;
    for (let j = 1; j < pages; j++) {
        const horizontalPos = pageWidth / 2;
        const verticalPos = pageHeight - 15;
        doc.setPage(j);
        doc.text('PERMISO SSP FEDERAL: DGSP/303-16/3302', horizontalPos, verticalPos + 5, { align: 'center' });
        doc.text('PERMISO SSP EDO. DE PUEBLA: SSP/SUBCOP/DGSP/114-15/109', horizontalPos, verticalPos + 10, { align: 'center' });
        doc.text(`${j}`, pageWidth - 10, verticalPos + 12, { align: 'right' });
    }
}

export const addHeader = (doc: jsPDF, title: string, dateTitle: string, name: string, numberAccounts: number, pageWidth: number, date: string,extraData?: string) => {
    // Logo
    doc.addImage(logo, pageWidth - 85, 5, 80, 40);
    doc.setFontSize(18);
    doc.text(`REPORTE DE ${title} ${name ? `DE ${name}` : ''}`, 5, 20, { maxWidth: pageWidth - 100 });
    // * Datos extras 
    doc.setFontSize(10);
    doc.text("PROTECCIÓN ELECTRÓNICA MONTERREY S.A. DE C.V.", 15, 39);
    doc.text(`${dateTitle} ${date}`, 15, extraData ? 53 :46);
    if (extraData){
        doc.text(extraData, 15, 46);
    }
    doc.text(`NÚMERO DE CUENTAS: ${numberAccounts}`, 15, extraData ? 60 : 53);
    // * Linea para datos extras
    doc.setDrawColor(0, 0, 66);
    doc.setLineWidth(0.8);
    doc.line(10, 35, 10, extraData ? 62 : 55);
}


